		"text": "수상자 여러분께는 [여왕님의 티파티] 티켓을 보내드릴 예정입니다.\n상을 받지 못한 분들은 아직 한 번의 기회가 남아있으니 너무 슬퍼마세요. \n공연 후 멋진 감상평을 뽐낼 수 있는 [자우림 덕후감 페스티벌]이 기다리고 있습니다.\n(*추후공지 예정)\n모두 자우림 [윈터 원더랜드]에서 뵙겠습니다.\n- V"
